var tipuesearch = {"pages":[{"text":"2017Spring 機械設計工程系協同產品設計實習 課程倉儲: http://github.com/mdecourse/2017springcd 課程投影片: http://mdecourse.github.io/2017springcd 課程網誌: http://mdecourse.github.io/2017springcd/blog","tags":"misc","title":"About","url":"./pages/about/"},{"text":"第一週上課內容 1.本學期課程概要 登錄Github到老師的Mdecourse的倉儲看大綱 有介紹一些3D軟體的相聯性 概略介紹C和PYTHON的優缺點 2.用正確的方式打開Stunnel 進入tiny2017_700MB>data>stunnel>config裡面,修改stunnel.conf 內容中的最後一段IP位置,要先在cmd中用ipconfig/all找出自己的IPV4位置 把這個IPV4位置覆蓋掉stunnel.conf最後一段IP位置後儲存,再把fossil程式關掉 重新打開程式就會正常顯示 之後試著登錄https://192.168.1.24/2017springvcp_hw/index 要記得先Proxy的進階選項設定另外的IP選項 才可以進入裡面做登錄的動作","tags":"Course","title":"2017CD第一週","url":"./2017springCD-Week1.html"},{"text":"第二週上課內容","tags":"Course","title":"2017CD第二週","url":"./2017springCD-Week2.html"}]};